A 15h20, le CTR du train Al Atlas 502 signale que le convoi s’est arrêté au km 81+000 depuis 15h04 après avoir ressenti un choc à la voie entre les kms 82+200 et 81+800 ;
Permanents PM, PV et CDT voie Mr Talbi avisés ;
Chef d’arrondissement maintenance avisé ;
A 16h10, départ du train Al Atlas 502 du km d’arrêt après visite de la voie, de la machine et rame et réfection des essais des freins par le CTR qui n’a rien constaté et qui a déclaré que le convoi continuera sa marche à vitesse réduite de 60 km/h jusqu’à Beni Ansar ;
Permanents PM et PV avisés ;
A noter que le CTR a procédé à la couverture de la zone incriminée et qu’il la supprimée après avoir l’assurance que le nécessaire est fait par le PCC ;  
A 17h00, le CDT sur place, déclare qu’il s’agit d’un tamponnement d’une brique au km 82+400 ;
A 17h30, le représentant de la GR au CNS a contacté le commandant de la gendarmerie de Saka pour la suite utile ;
Des ralentissements de 30 km et 60 km ont été prescrit respectivement aux trains 5209 et 5210 qui ont été accompagnés entre ces 2 gares ; Résultats : RAS.
A 18h35, le CDT voie a rétabli la circulation à vitesse normale.

Renouvellement de caténaire voie 2 entre Sidi Hajjaj et Ras El Ain. Sans conséquences.
ATS n°81/2022 du 01/11 au 31/12/2022 :
DIV sur voie 2 Sidi Hajjaj Ras El Ain, accordée à 23h30, rendue à 3h30 le 14/12/2022 ; 
Interrupteur 22 de Ras El Ain ouvert à 23h38, fermé à 3h39 ;
Interrupteur 21 de Sidi Hajjaj ouvert à 23h36, fermé à 3h41.

Message du Permanant CNS :
Train 132 ;
Une vitre du porte de communication de la voiture 7528 a été désemparée de sa place en cours de route, entre les gares de Sidi Yahia et Kenitra.

