A 8h43, le permanent PV fait savoir que le train Al Atlas 605 sera secouru par la machine E1410 du train 141 ;
A 8h46, départ de la machine E1410 de Casa RN ;
A 9h05, arrivée de la machine E1410 à Casa Voyageurs ;
A 9h45, départ du train Al Atlas 605 de Casa Voyageurs après mise en tête et réfection des essais des freins ;
Le train Al Atlas 141 a été assurée par la machine E1403 du train Al Atlas 900.

A 11h53, le CTR du train 9606 signale que le convoi s’est arrêté au km 21+100 depuis 11h50 suite avarie de la machine E1118 ;
Casa RN, PR et Tamdrost avisés de préparer le secours ;
Permanents PFL et PM avisés ;
A 12h20, départ de la machine E1412 de Casa RN ;
A 12h30, VUT organisée sur voie 2 entre Nouasser et Bouskoura après dégagement du train Al Atlas 611 ;
A 12h56, arrivée de la machine E1412 à Bouskoura ;
A 13h10, départ de la machine E1412 de Bouskoura vers le train en détresse ;
A 13h16, arrivée de la machine E1412 au km d’arrêt ;
A 13h35, départ du train 9606 du km d’arrêt ;
A 14h01, VUT supprimée.

A 17h45, le CDT ALLAM prescrit un ralentissement de 30 km/h du km 55+500 au km 55+800 entre Tnine Sidi Lyamani et Asilah ;
A 17h38, le CTR du train Al Atlas 354 (E1461 :6-269) signale l’arrêt du convoi au km 79+300 au droit d’un SAM posé par un collaborateur voie de 17h30 à 17h32 suite débordement massive des eaux de pluies et lui prescrit un ralentissement de 5 km/h du km 79+100 au km 79+100 entre Oued Al Makhazine et Tleta Rissana ;
A 17h45, le CDT ALLAM prescrit un ralentissement de 5 km/h du km 79+100 au km 79+100 entre Oued Al Makhazine et Tleta Rissana ;
A 20h10, le CDT ALLAM rétabli la vitesse normale entre km 79+100 au km 79+100 entre Oued Al Makhazine et Tleta Rissana ;
A 22h50, le CDT ALLAM rétabli la vitesse normale entre km 55+500 au km 55+800 entre Tnine Sidi Lyamani et Asilah ;
Message du CDT Voie
Débordement sur la voie par de la boue avec les solides emportés par l’arrivée massive des eaux du côté droit bassin versant au km 12+750 et 12+850
•       Brèche coté FG suite ballast emporté par les débordements des eaux massives du bassin versant côté droit au km 14+100 sur longueur de 60 ml et au km 14+600 sur une longueur de 20 ml 
•       Arrivée train ballast de 8 wagons de Kacem à Fès
•       Départ tarin MI voie ballast depuis la gare de Fès pour ballastage 
•       Prévision rétablissement dans 2h00

A 3h03 le 15/12/2022, le CTR du train Al Atlas 306 (E1468 :8-354) signale que le convoi s’est arrêté au km 100+000 depuis 3h02 suite voie inondée ;
A 3h04, le CDT voie Mr ALLAM et Chef Section Maintenance avisés ;
Permanents PV et CNS avisé ;
A 3h05, M BEHJI avisé ;
A 3h30, Chef Section Maintenance a prescrit une limitation de vitesse de 5 km/h entre les km 99+900 et km 100+200 entre Ksar El Kebir et Oued El Makhazine ;
A 3h30, départ du train Al Atlas 306 du km d’arrêt accompagne par M YAHIA SAID a vitesse de 5km/h jusqu’à km 99+700 puis il a observé la marche prudente jusqu’ à Sidi Lyamani ;
A 5h32, Chef Section Maintenance rétabli la vitesse normale entre les km 99+900 et km 100+200 entre Ksar El Kebir et Oued El Makhazine ;

A 11h55, le CTR du TNR 808 signale l’extinction du signal n°14,2 ;
A 12h15, le CTR du train Al Atlas 611 signale l’extinction du signal n°13,8 ;
Centre de supervision avisé.
Rétabli à : 13h00
Motif : BAF défectueux, bon après remplacement.

A 13h55, déclenchement des disjoncteurs F11 de la sous station de Sidi Taibi et F12 de la sous station de Kenitra ;
A 13h57, arrêt du TNR 23 au km 123+800 suite manque tension en ligne ;
A 13h58, le train Al Atlas 143 a été arrêté au km 114+300 entre Bouknadel et Sidi Taibi pour recevoir un ordre de marche prudente pour visite de la caténaire ;
A 14h00, rétablissement des disjoncteurs ;
A 14h08, départ du TNR 23 du km d’arrêt ;
A 14h11, départ du train Al Atlas 143 du km d’arrêt.
Message du chef de section maintenance Mr KENZARI :
Prière de reclasser l’événement de déclenchement ci-dessous parmi les intempéries, étant donné qu’il a eu lieu suite aux fortes pluies et orages qu’a connu la zone en question.

A 7h48, le chef circulation du PCD de Bouznika signale que le TNR 3 n’a pas encore fait son départ depuis 7h46 suite défaut de lecture des nœuds des rames ;
Permanents PM et PV avisés ;
A 7h54, départ du TNR 3 Bouznika après intervention du conducteur de ligne.

A 11h00, le permanent PV fait savoir que la machine DM611 de manœuvre est avariée et que la machine de réserve DM612 de réserve sera utilisé pour la mise à disposition des rames des trains 143 et 903 ;
Permanents PM avisé ;
Mise à disposition tardive de la rame du train Al Atlas 143 à 11h56 au lieu de 10h30 après démarrage de la machine DM 612 de réserve ;
Mise à disposition tardive de la rame du train Al Atlas 903 à 13h05 au lieu de 12h15 ;

A 15h25, le chef circulation CTC Laâssilat El Jorf signale que le TNR 812 s’est arrêté en gare d’Azemmour depuis 15h23 suite disjonction de la ZM13 ;
Permanents PM et PV avisés ;
A 15h35, le CTR du TNR 812 signale la difficulté de réarmement de la ZM13 ;
A 15h36 ; le régulateur PR Casa est invité à préparer une rame Z2M pour le secours ;
A 15h45, le permanent PV signale l’impossibilité de réarmement de la ZM13 et ajoute que cette rame sera retirée à cette gare et les voyageurs seront transbordés dans la ZM11 de tête ;
A 16h10, le permanent PV fait savoir que le TNR 813 va faire le départ sans retrait de la ZM13 ;
A 16h17, départ du TNR 813 après isolement d’un hacheur de la ZM13.

A 16h40, le chef de sécurité de Benguerir signale que le train Al Atlas 622 est toujours en gare depuis 16h34 suite à un problème au niveau du coupleur 380V de la machine ;
Permanents PM et PV avisés ;
A 16h55, le permanent PV signale que le train Al Atlas 622 va faire le départ de Benguerir sans climatisation ni éclairage jusqu’à Casa Voyageurs où ladite machine sera échangée ;
A 17h02, départ du train Al Atlas 622 de Benguerir après mise en place d’une lanterne de queue ;
A 19h03, arrivée du train Al Atlas 622 à Casa Voyageurs ;
A 19h18, retrait de la machine E1451 ;
A 19h32, mise en tête de la machine E1402 sur la rame du train Al Atlas 622/127 ;
A 19h51, départ du train Al Atlas 127 de Casa Voyageurs après essais de freins et dégagement du train V15240.

A 17h59, le chef circulation du PCL Mohammedia signale que le TNR 45 s’est arrêté à l’entrée de sa gare ;
Contacté, le CTR du TNR 45 signale que le convoi s’est arrêté au km 22+300 à l’entrée de Mohammedia de 17h56 à 18h02 par action d’un signal d’alarme dans la voiture M116 par des voyageurs qui ont constaté le dégagement de la fumée de la cabine de conduite arrière de la Z2M116 et ajoute que le départ a été effectué après isolement du GS et traction M116 ;
Permanents PM et PV avisés

A 18h05, le régulateur caténaire signale le déclenchement des disjoncteurs F11 de la sous station de Bouknadel et F12 de la sous station de Sidi Taibi avec réenclenchement automatique à 17h58, 18h00 et 18h02 ;
Questionné, le CTR du TNR 41 signale des disjonctions de la Z2M102 ;
Permanents PM et PV avisés ;
A 18h09, arrêt du TNR 41 à Sidi Taibi ;
