A 8h27, arrêt du TNR 802 par GSM au km 4+900 ;
A 8h34, départ du TNR 802 du km d’arrêt après fermeture des portes de la ZR13 qui ont été ouvert par la poignée de secours actionné par inconnu.
Permanents PM et PV avisés.

