Chef de site sûreté avisé.
Vers 16h12'', le représentant de la DGSN au CNS a contacté la BT Asilah pour information et suite utile.

A 17h21, le CTR du TNR 662 signale que le convoi s’est arrêté au km 40+400 entre Berrechid et Nouaceur de 17h19 à 17h20 suite tamponnement d’un chien au km 40+800 ;
Permanents CNS, PM et PV avisés ;
CDT voie Mr Sghir avisé déclare que la zone est non clôturée.

A 17h39, le CTR du TNR 812 signale que le convoi s’est arrêté au km 4+600 entre l’Oasis et Casa Voyageurs de 17h37 à 17h38 suite tamponnement d’un chien au km 4+800 ;
Permanents PM, PV et CNS avisés ;
CDT voie Mr Chakir avisé déclare que la zone est clôturée par mur en béton.

 A 17h30, le CTR du TNR 662 signale la stagnation des eaux au km 39+400 au voisinage de la voie 1 entre Nouaceur et Berrechid ;
A 17h32, le CTR du TNR 661 a été invité de de redoubler l’attention à l’approche dudit km ;
CDT Voie Msghir avisé ;
A 18h11, le CDT Voie M SGHIR a prescrit un ralentissement de 60 km/h du km 39+300 au km 39+500 entre Nouaceur et Berrechid suite débordement des eaux pluviales mélangés avec les eaux usées sur la voie 1 du km 39+300 au km 39+500 ;
A 18h41, le CDT Voie M SGHIR a retabli la vitesse normale des trains du km 39+300 au km 39+500 entre Nouaceur et Berrechid ;
Rapprt du CDT Voie M SGHIR :
Vers 17H10 du 14/12/2022, le train AL ATLAS N°662 a signalé présomption de débordement des eaux usées au voisinage de la voie 1 entre les gares de NOUACEUR et BERRECHID au km 39+400 de la ligne NOUACEUR/SIDI EL AIDI.
Il s’agit du débordement des eaux pluviales mélangés avec les eaux usées au droit du bassin de décantation sur la V1 au niveau du km 39+300/500.
Les eaux en débordés traversent la voie 1 vers la voie 2 le ballast au niveau de la banquette sans risque pour les circulations et sans amorce de brèche ni risque de déstabilisation de la voie.
A noter que la zone est sous surveillance ainsi que des travaux de débouchage de l’extrémité de bassin ont été réalisés l’après-midi de ce jour.
A 18h04, Le CDT 212V Mr SGHIR a prescrit un ralentissement de 60km/h pour train n°663 seul pour s’assurer du comportement de la voie 1 lors du passage du train.
Rétablissement de la vitesse normale sur la V1 à 18h29 juste après le passage du train. 
A noter que le bassin des eaux pluviales fait partie des études de l''amélioration de la capacité de stockage et d''évacuation des eaux pluviales de la ville de Berrechid, ce projet est suivi par la région du CASABLANCA.

ATS N°78/2022 du 13/10 au 31/12/2022 :
