A 8h18, le CDT voie Mr ALLAM signale que les trains peuvent circuler normalement et que ladite zone est surveillée ;
A 11h13, le CDT voie Mr ALLAM a prescrit un ralentissement de 5 km/h du km 60+300 au km 60+800 entre Sidi Lyamani et Asilah suite arrivée massive des eaux ;
A 11h14, le CDT voie Mr HAMMOUCH a autorisé la circulation normale des trains entre Guercif et El Agreb ;
A 11h56, le CDT voie Mr ALLAM a rétabli la circulation normale des trains du km 60+300 au km 60+800 et a supprimé la limitation de vitesse de 5 km/h :
A 12h35, le CDT voie Mr Ansari a autorisé la circulation des trains entre Fès et Sidi Hrazem avec une limitation de vitesse de 30 km/h du km 12+600 au km 14+600 ;
A 12h37, le CDT voie Mr Ansari a prescrit une marche prudente entre Fès et Touabâa ;
A 12h58, le CDT voie Mr Hammouch autorise la vitesse normale entre Taza et Guercif ;
A 13h17, le CDT voie Mr Hammouch autorise la vitesse normale entre Taza et Touabâa ;
