A 14h40, le CDT voie Mr Ansari interdit les circulations des trains entre Fès et Sidi Hrazem suite inondation voie entre les kms 12+000 et 14+600 ;
A 20h00, le CDT voie Mr Hammouch interdit les circulations des trains between Taza et Bab Marzouka suite inondation voie entre les kms 116+400 et 116+800 ;
Débordement d’un oued (Larbaâ) causant une inondation sur 400 mètres entre Bab Marzouka et Taza avec des dégâts à la voie. 
A 5h30 le 16/12/2022, le CSM M LKHAWA fait savoir que :
Les travaux de dégagement des déblais sont terminés sur la section Fès Sidi Hrazem ;
Préparation du logistique pour rétablissement des circulations.
Gestion du service voyageurs :
