A 11h19, départ du 2ème autocar de Fès transportant 48 voyageurs vers Taza ;
A 11h20, départ du 3ème autocar de Fès transportant 40 voyageurs vers Taza ;
A 12h10, départ de 2 autocars de Taza transportant 100 voyageurs vers Fès ;
A 12h15, départ du 3ème autocar de Taza transportant 59 voyageurs vers Fès.

A 7h40, le régulateur Casa signale le dérangement de la zone 205 sur voie 1 entre CRN/Casa Port et Ain Sebâa/Casa Voyageurs ;
A 7h41, avis au centre de supervision ;
Le TNR 5 (Z2M 114) s’est arrêté au niveau du chevron de l’aiguille C de 7h53 à 7h57 pour utilisation de l’ATR n°01 ;
A 8h11, dérangement disparu.
Rétabli à : 10h00.
Motif : Baisse d’isolement voie suite pluie, bon après intervention des collaborateurs de la voie.
Message PV à 10h55 :
Le TNR 5 a subi 20mn de retard entre Casa Port et Ain Sebâa, par conséquent le TNR 16 est parti avec 25 mn de retard au départ de Kenitra.
Les TNR 21 et 26 seront supprimés en conséquences.

A 11h46, le CTR du train 7615 signale l’arrêt du convoi au km 63+700 depuis 11h45 entre Youssoufia et Bidane suite dépression d’air non provoquée par le conducteur de ligne ;
A 11h47, avis aux permanents PM et PFL ;
A 12h36, départ du train du km d’arrêt après isolement des trémies n°0692169 et 0692205, classées respectivement 5 et 25ème de queue ;
A 12h3, le CTR du train 7615 signale que le convoi s’est arrêté au km 67+200 entre Youssoufia et Bidane depuis 12h50 pour le même motif ;
Permanents PM et PFL avisés ;
A 14h03, départ du train 7615 du km d’arrêt après remplacement du joint du ½ accouplement du wagon 0692175 classé 18ème de queue.
1er message du permanent PFL :
Le train 7615 (E1101/59/718/4640, CL : ERAACHDI, train de phosphate chargé à destination de la gare haute) s’est arrêté au km 63+700 entre YOUSSOUFIA et BIDANE à 11h45, suite une dépression dans la conduite générale non provoquée par le conducteur. Après visite de la rame par ce dernier, il'' a constaté le blocage des wagon N° 0692169, 5éme de queue, et N° 0692205 25éme de queue, causé par des fuite d’air au niveau du distributeur pour le 1er wagon et au niveau du cylindre de frein pour le 2éme. Le train a repris sa marche à 12h36, après isolement des 2 wagons.
2ème message du permanent PFL :
Le train 7615 s’est arrêté à nouveau au km 67+200 entre les mêmes gares de 12h50 à 14h03 pour le même motif. Apres visite, il a été constaté une fuite au niveau de demi accouplement du wagon n°0692175 classé 18éme de queue. Fuite disparue après remplacement du joint.

A 5h44, le chef de sécurité de Fès signale être avisé par le CTR du train 104 que le frein à vis de la voiture de queue n°3066 est avarié ;
A 5h45, avis aux permanents PM et PV ;
A 5h59, le chef de sécurité de Fès signale que les 20 voyageurs de la voiture de queue ont été transbordés dans une autre voiture et la voiture de queue circulera HLP et fermée ;
A 6h04, départ du train 104 de Fès.
Message PM :
La vérification du frein à vis avant refoulement de la rame vers le quai est du ressort du chef de formation,
Il y a lieu de responsabiliser le PV pour la non vérification du frein à vis avant refoulement de la rame du train 106 vers the quai.

A 8h06, le CTR du TNR 3 signale l’arrêt du convoi au km 71+600 de 8h01 à 8h05 suite tamponnement d’un chien au km 70+800 et RAS après visite des rames et la voie dégagée ;
A 8h07, permanents PM, PV et CNS avisés ;
A 8h08, le CDT voie Mr Abbassi avisé signale que la zone est clôturée par fil barbelé ;
A 8h15, Mr Kharmaz demande la suppression du TNR 12 sur tout son parcours suite immobilisation des Z2M 124 et 106 pour visite et ses voyageurs emprunteront le train Al Atlas 106 à retarder à Kenitra ;
Message du PM :
Les rames Z2M 124 et Z2M 106 objet du tamponnement du TNR 3 viennent d’être vérifiées au technicentre de maintenance de KENITRA.
Un léger méplat a été constaté au niveau de l’essieu E1 RB 106 sans incidence sur les règles de conduite.
La rame Z2M 106 sera traitée en tour en fosse cette semaine.
Départ du TNR 31 à 14h37 au lieu de 14h10 après réutilisation des Z2M116 et 120 du TNR 28 
Départ du TNR 35 à 15h43 au lieu de 15h10 après réutilisation des Z2M109 et 118 du TNR 32 
Départ du TNR 37 à 15h50 au lieu de 15h35 après réutilisation de la Z2M121 du TNR 660 ;
Départ du TNR 43 à 17h30 au lieu de 17h10 après réutilisation des Z2M119 et 108 du TNR 40 
Message du permanent PM :
Les suppressions des TNR de RABAT sont les conséquences de la suppression du TNR 12 suite au tamponnement du TNR 3.
Merci de rectifier le libellé de l’incident. Ci- joint le signalement d’arrêt accidentel du TNR3.

