Patinage non prolongé du train 1237 (E1405/17/277/1235, CL : EL OUARTASSI, train de gasoil chargé à destination de MEKNES) entre le KM 250 et la gare de MEKNES (km 254+400), fonctionnement des sablières 4/4 et tous les bacs à sable sont remplies à SIDI KACEM.

