Rapport du CDT voie :
L’accident s’est produit suite à : Inattention, Insouciance et précipitation du chauffeur de la voiture.
En roulant sur la route goudronnée reliant la commune CHAABA et la commune Boujniba, arrivant à proximité du PN OCP pr504 situé au km 149+395, le chauffeur en état d’ivresse n’a non seulement pas respecté l’indication du panneau STOP posé à 5.00 m du PN mais n’a pas fait attention à l’arrivée du train 9726 et s’est précipité devant le train et a été tamponné et accroché au tampon pour être transporté après choc sur 30 ml le long de la voie. 
La responsabilité incombe au chauffeur de la voiture qui était dans un état anormal, qui n’a pas obéit à la signalisation routière et s’est précipité pour traverser le passage devant la machine qui l’a percuté.
Message du PFL :
Le train 9726 (E1118 Cdt 60-742-4800T CL : RAREDEGUE) s’est arrêté en urgence au KM 150+00 a la sortie de la gare de BNI IDIR vers 19h45 après avoir tamponné une voiture Mitsubishi matriculé (6-A-94659) au niveau du passage à niveau non gardé, la porte du véhicule reste accrochée au tampon de la machine, le propriétaire a pris la fuite. PPIC avisé.
Refoulement du train, après dégagement du tampon, vers la gare de BNI IDIR de 21h15 à 21h19.
